export default {
  name: "Style",
  mounted() {
    this.loadScripts();
  },
  methods: {
    loadScripts() {
      const scriptUrls = ['/public/js/bootstrap.bundle.min.js', '/public/js/custom.js', '/public/js/tiny-slider.js'];
      const head = document.getElementsByTagName('head')[0];
      scriptUrls.forEach(scriptUrl => {
        const script = document.createElement('script');
        script.src = scriptUrl;
        script.async = true;
        head.appendChild(script);
      });
    }
  }
};
